INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1001, 0, 1, 2, 0, 1, 0, "お！\nあそこに困ってそうな人発見！", "ねぇねぇ、騎士クン\n手伝ってあげようよ～", "春咲 ひより", 1.4, 0, 1, 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1002, 0, 1, 2, 0, 1, 0, "大切な人を\n守れるようになりたい…って", "わ、わたし、\nなに言ってるんだろ\nあはは…", "草野 優衣", 1.4, 0, 1, 0, "みんなみたいに\nわたしも強くならなきゃ");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1003, 0, 1, 2, 0, 1, 0, "キミに必要な集中力と感性が", "少しは磨かれると思いますよ。", "士条 怜", 1.4, 0, 1, 0, "フェンシングを始めてみては？");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1004, 0, 1, 2, 0, 1, 0, "今日はなにして遊ぶ？", "みそぎはねぇ、\nかくれんぼやりたい！", "穂高 みそぎ", 1.5, 0, 1, 0, "ねぇ、にいちゃん！");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1006, 0, 1, 2, 0, 1, 0, "ねぇ…", "私といっしょに…\nいかない？", "風宮 あかり", 1.4, 0, 1, 0, "風宮あかりです");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1007, 0, 1, 2, 0, 1, 0, "プリンたべたいのー", "食べ物の恨みは怖いのー", "出雲 宮子", 1.5, 0, 1, 0, "出雲宮子なのー");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1008, 0, 1, 2, 0, 1, 0, "キミもボクの美貌に\n吸い寄せられたんだね。", "いいよ。\n見られることは運命さ…", "虹村 雪", 1.4, 0, 1, 0, "ボクは虹村雪。");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1009, 0, 1, 2, 0, 1, 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", "人呼んで「疾風の冥姫」!!", "柊杏奈", 1.4, 0, 1, 0, "フッ…聞いて後悔するがいい！");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1010, 0, 1, 2, 0, 1, 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", "ほんまおおきにやわ～♪", "姫宮 真歩", 1.5, 0, 1, 0, "マホマホ王国のプリンセス、\nまほ姫どす");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1011, 0, 1, 2, 0, 1, 0, "生き別れたお兄ちゃんを探して\n三千世界！", "ここで会ったが\n100年目～！", "衣之咲 璃乃", 1.4, 0, 1, 0, "衣之咲璃乃です！");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1012, 0, 1, 2, 0, 1, 0, "ち、超能力って…\n何のことかな～？", "…って、お願い！\n誰にも言わないでおいて～！", "柏崎 初音", 1.4, 0, 1, 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1016, 0, 1, 2, 0, 1, 0, "一応カリスマ読モJKやってまっす！", "ヒデサイまぢ\nGF（グッドフィーリング）～♪", "美波 鈴奈", 1.4, 0, 1, 0, "ちょす！\n美波鈴奈だよ～♪");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1017, 0, 1, 2, 0, 1, 0, "東京は遊園地みたいなところさー", "でも、沖縄もとってもいいとこさー", "喜屋武 香織", 1.4, 0, 1, 0, "はいたーい。\n喜屋武香織さー。");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1018, 0, 1, 2, 0, 1, 0, "先生って呼ばれるのは\nくすぐったいから", "イオちゃんって呼んでね。", "支倉 伊緒", 1.4, 0, 1, 0, "支倉伊緒です。");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1020, 0, 1, 2, 0, 1, 0, "あ！/\お兄ちゃ～ん\nまってよ～", "ミミをおいてかないでぇ～", "茜 ミミ", 1.5, 0, 1, 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1021, 0, 1, 2, 0, 1, 0, "あの……\nふぇ……", "ふぇぇぇぇぇん……", "栗林 くるみ", 1.5, 0, 1, 0, "あ…あの…えっと…\n栗…林…くるみ…です……");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1022, 0, 1, 2, 0, 1, 0, "こんな私に貴重な時間を\n割いていただき、", "なんてありがとうございます！", "風宮 より", 1.4, 0, 1, 0, "風宮よりです。\nあああああ！");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1023, 0, 1, 2, 0, 1, 0, "おにいちゃんどこいくの？\nえ？", "私こっち行きたいー\nね、早く早くー", "北条 綾音", 1.5, 0, 1, 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1025, 0, 1, 2, 0, 1, 0, "ふ、不束者ですが\nどうぞ末永く…って、", "これて何か違う…\nあああすみません！", "天野 すずめ", 1.4, 0, 1, 0, "わっ…わっ…私、\n天野すずめといいます！");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1027, 0, 1, 2, 0, 1, 0, "あなたは…運命の……\n伴侶……", "離しませんわ………\n絶対に…!!", "倉石 恵理子", 1.4, 0, 1, 0, "……クスクス…私は\n…倉石恵理子……");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1028, 0, 1, 2, 0, 1, 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", "…そうでしょ？？", "佐々木 咲恋", 1.4, 0, 1, 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1029, 0, 1, 2, 0, 1, 0, "ぇっと…\nキミ、私のこと知らないの?!", "あはは、\n私もまだまだだなぁ～", "桜井 望", 1.4, 0, 1, 0, "桜井望だよ！\nよろしくねっ");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1030, 0, 1, 2, 0, 1, 0, "初めまして、\n私はニノン・ジュベール申すデス！", "ショーグン、\nワタシと一緒に天下統一デース！", "ニノン・ジュベール", 1.4, 0, 1, 0, "デケデケデンっ！");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1031, 0, 1, 2, 0, 1, 0, "でもって私の隣にいるのが……\nえ、見えない？", "おかしいですね……", "上喜 しのぶ", 1.4, 0, 1, 0, "上喜しのぶです。\n手元のドクロが父です。");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1033, 0, 1, 2, 0, 1, 0, "けんども\nそれには足りないモンが…", "そう、\nオラのボケに突っ込める相方が…！", "野戸まひる", 1.5, 0, 1, 0, "目指すはビッグな\nお笑い芸人だっぺ！");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1034, 0, 1, 2, 0, 1, 0, "ちょっと緊張しちゃって…", "ちょ\nちょっと一杯飲んできます…！", "綾瀬 ゆかり", 1.4, 0, 1, 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1036, 0, 1, 2, 0, 1, 0, "知らない人とは話しちゃいけないので", "これ以上お話しすることは…\nないです！", "氷川 鏡華", 1.5, 0, 1, 0, "氷川鏡華…です");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1038, 0, 1, 2, 0, 1, 0, "……あ、アラーム。", "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", "柏崎 栞", 1.4, 0, 1, 0, "柏崎…栞です。");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1040, 0, 1, 2, 0, 1, 0, "私、一人も友達がいなくて……", "野に咲く花が、\n唯一の話相手です。", "双葉 碧", 1.4, 0, 1, 0, "ふ、双葉碧です。");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1042, 0, 1, 2, 0, 1, 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", "そう思っています。", "三角 千歌", 1.4, 0, 1, 0, "三角千歌です。");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1043, 0, 1, 2, 0, 1, 0, "あぁ？\nお前のそいつの仲間か？", "う、疑ってすまなかったな…", "安芸 真琴", 1.4, 0, 1, 0, "安芸真琴だ。");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1044, 0, 1, 2, 0, 1, 0, "生けとし生ける全ての者よ！", "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", "イリヤ・オーンスタイン", 1.4, 0, 1, 0, "わらわこそは夜を総べる者！");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1045, 0, 1, 2, 0, 1, 0, "ぐふふふふ……はっ！", "ｌク、クウカに何かご用ですか!?", "遠見 空花", 1.4, 0, 1, 0, "そこで騎士は妖精を乱暴に……");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1046, 0, 1, 2, 0, 1, 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", "う～ん…\n猫ってホントに最高にゃ～♪", "宮坂たまき", 1.4, 0, 1, 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1048, 0, 1, 2, 0, 1, 0, "それでは早速クエストに…", "…と思ったら\nバイトの時間だ！\nまたあとでね！", "大神 美冬", 1.4, 0, 1, 0, "大神美冬よ！");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1049, 0, 1, 2, 0, 1, 0, "クエストもバトルも\n掃除も洗濯も", "お姉ちゃんがぜ～んぶ\nやってあげるからね！", "星野静流", 1.4, 0, 1, 0, "星野静流だよ！");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1050, 0, 1, 2, 0, 1, 0, "見ての通りの\nセクシー美少女で", "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", "玉泉美咲", 1.5, 0, 1, 0, "アタシは玉泉美咲。");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1052, 0, 1, 2, 0, 1, 0, "？？？？", "？？？？", "リマ", 1.4, 0, 1, 0, "？？？");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1053, 0, 1, 2, 0, 1, 0, "菓子でつろうなどと\n稚拙な策を……", "そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィント", 1.5, 0, 1, 0, "モニカ・ヴァイスヴィントだ。");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1058, 0, 1, 2, 0, 1, 0, "菓子でつろうなどと\n稚拙な策を……", "そ、そこまでいうなら\nもらってやる", "ペコリーヌ", 1.5, 0, 1, 0, "モニカ・ヴァイスヴィントだ。");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1059, 0, 1, 2, 0, 1, 0, "菓子でつろうなどと\n稚拙な策を……", "そ、そこまでいうなら\nもらってやる", "コッコロ", 1.5, 0, 1, 0, "モニカ・ヴァイスヴィントだ。");
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1060, 0, 1, 2, 0, 1, 0, "菓子でつろうなどと\n稚拙な策を……", "そ、そこまでいうなら\nもらってやる", "キャル", 1.5, 0, 1, 0, "モニカ・ヴァイスヴィントだ。");
